package com.base.project.main;import android.os.Bundle;import android.support.annotation.Nullable;import com.alibaba.android.arouter.facade.annotation.Route;import com.alibaba.android.arouter.launcher.ARouter;import com.base.project.R;import butterknife.OnClick;import me.csxiong.library.base.mvp.MVPActivity;@Route(path = "/main/toMain")public class MainActivity extends MVPActivity<MainPresenter> implements MainContract.View {    @OnClick(R.id.btn_open_login)    public void onOpenLogin() {        ARouter.getInstance().build("/login/login")                .navigation();    }    @OnClick(R.id.btn_open_example)    public void onOpenNext() {        ARouter.getInstance().build("/multi/next")                .navigation();    }    @Override    public int getLayoutResId() {        return R.layout.activity_main;    }    @Override    public void initUI(@Nullable Bundle savedInstanceState) {    }    @Override    public void initData(@Nullable Bundle savedInstanceState) {    }}